import React, { useState } from 'react';
import './SearchContact.css';

export default function SearchContact({ contacts }) {
  const [search, setSearch] = useState('');
  const [view, setView] = useState([]);
  function searchUpdate() {
    const filterData = contacts.filter(contact =>
      contact.name.includes(search) ||
      contact.age.includes(search) ||
      contact.number.includes(search)
    );
  
    const uniqueNames = new Set();
    const uniqueData = filterData.filter(contact => {
      if (uniqueNames.has(contact.name)) {
      
      } else {
        uniqueNames.add(contact.name);
        
      }
    });
  
    setView(uniqueData);
  }
  
      
    
  

  return (
    <div>
      <nav>
        <input type='search' placeholder='Search' onChange={(e) => setSearch(e.target.value)} />
        <button onClick={searchUpdate}>Search</button>
      </nav>
      <div>
        {view.map((contact, index) => (
          <div key={index}>
            <p>{contact.name}</p>
            <p>{contact.age}</p>
            <p>{contact.number}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
